import React from "react";
import Reactdom from "react-dom";
// import Card from "./App2";

function Cards(props) {
    return (
        <div className="container">
            <div className="top">
                <h2 className="name">{props.name}</h2>
                <img
                    src={props.img}
                />
            </div>
            <div className="bottom">
                <p>{props.tel}</p>
                <p>{props.email}</p>
            </div>

        </div>
    )
}
export default Cards;
